function Header() {
  

    return (
      <header className="header">
        <div className="inputs-container">
          <input
            className={`header__input`}
            type="text"
            placeholder="Поиск"
            name="search"
          />
        </div>
        
        <button></button>
      </header>
    );
  }
  
  export default Header;
